import React from 'react';
import {Component} from 'react';
import Webcam from 'react-webcam';

class Camera extends Component {

    handleSpacePress = (e) => {
        if (e.key === 'Space') {
            console.log("Success");
        }
    }

    render() {
        return (
            <div>
                <Webcam
                    audio = {false}
                    height = {1000}
                    width = {1000}
                    screenshotFormat = "image/png"
                />

            </div>
        )
    }
}

export default Camera;
